As part of the Washington School Recognition Program, our schools are being recognized for two categories by the state! Our schools close gaps, serving ALL students, and we demonstrate growth in supporting those students. Congrats #QuincyMiddleSchool #GeorgeElementary and #PioneerElementary!

#WAedu #WSRP

